// RoleSelection.js
// Landing page that asks visitors to choose whether they are a private individual
// or a legal entity. Selecting an option navigates to the appropriate
// section of the site. The hero banner and styling mirror the original
// home page to maintain brand consistency.

import React from 'react';
import { Link } from 'react-router-dom';

const RoleSelection = () => {
  return (
    <div className="role-selection">
      <header className="hero">
        <h1>AI.Print Studio</h1>
        <p className="hero__subtitle">
          Ваш партнёр по быстрой и качественной печати. Фотографии, документы,
          полиграфия — все в одном месте.
        </p>
      </header>
      <section className="role-selection__options" style={{ textAlign: 'center', padding: '2rem' }}>
        <h2 style={{ marginBottom: '1.5rem' }}>Выберите категорию клиента</h2>
        <div className="role-buttons" style={{ display: 'flex', justifyContent: 'center', gap: '2rem' }}>
          <Link to="/personal" className="btn btn-primary" style={{ minWidth: '200px' }}>
            Физические лица
          </Link>
          <Link to="/legal" className="btn btn-primary" style={{ minWidth: '200px' }}>
            Юридические лица
          </Link>
        </div>
      </section>
    </div>
  );
};

export default RoleSelection;
